import React from "react";
import "./Header.css";

function Header() {
  return (
    <div className="header">
      <div className="btn-signup">
        <p>S</p>
      </div>
      <div className="btn-login">
        <p>LOG IN</p>
      </div>
    </div>
  );
}

export default Header;
